// import React from "react";

const listCity = [
  {
    "name": "Dublin",
    "subText": "123 properties",
    "image": "./images/city_1.webp"
  },
  {
    "name": "Reno",
    "subText": "533 properties",
    "image": "./images/city_2.webp"
  },
  {
    "name": "Austin",
    "subText": "532 properties",
    "image": "./images/city_3.webp"
  }
]



function ListCity() {
  return (
    <div className='listcity'>
      {listCity.map(city => (
        <div className='background-listcity' key={city['name']} style={{ background: `url(${city['image']}) no-repeat right top` }}>
          <div>
            <h2>{city['name']}</h2>
            <h4>{city}</h4>
          </div>
        </div>
      ))
      }
    </div>
  )
}


export default ListCity;
